import { Component, Prop, Vue } from "vue-property-decorator";
import GameBoard from "./components/GameBoard.vue";

@Component({
  components: {
    GameBoard
  }
  props: ['splashMessage']
})
export default class Scythe extends Vue {
  //@Prop() splashMessage: string;


  constructor() {
    super();
    this.splashMessage = "ok";
  }

  mounted() {
    document.getElementById("GameBoard").classList.toggle("d-none");
  }
}
